        const json = await response.json();

        console.log(json);
      };


    render() {
        return (
            <div>
        Crypto Values

        Crypto Code:
        <input name="crypto_name"></input>
        Currency: <input name="currency"></input> <br />
            <button onClick={fetchAndLog}>Submit</button>
            <input type="button" value="Cancel" name="Cancel"></input>
            <p>{fetchAndLog}</p>
            </div>
        )}; 

}
